CREATE TABLE home.achievements
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    name varchar(255),
    message varchar(255)
);
CREATE TABLE home.characters
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    name varchar(255),
    fk_first_line int(11) DEFAULT '1',
    fk_second_line int(11) DEFAULT '4',
    CONSTRAINT characters_characters_lines_pk_fk FOREIGN KEY (fk_first_line) REFERENCES home.characters_lines (pk),
    CONSTRAINT characters_characters_lines_pk_fk_2 FOREIGN KEY (fk_second_line) REFERENCES home.characters_lines (pk)
);
CREATE UNIQUE INDEX character_name_uindex ON home.characters (name);
CREATE INDEX characters_characters_lines_pk_fk ON home.characters (fk_first_line);
CREATE INDEX characters_characters_lines_pk_fk_2 ON home.characters (fk_second_line);
CREATE TABLE home.characters_levels
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    level tinyint(3) unsigned,
    experience int(10) unsigned
);
CREATE TABLE home.characters_lines
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    name varchar(255)
);
CREATE TABLE home.characters_parametrs
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fk_character int(11),
    level tinyint(3) unsigned,
    move_speed int(10) unsigned,
    physical_attack int(10) unsigned,
    magic_attack int(10) unsigned,
    first_line_value int(10) unsigned,
    second_line_value int(10) unsigned,
    CONSTRAINT characters_parametrs_characters_pk_fk FOREIGN KEY (fk_character) REFERENCES home.characters (pk)
);
CREATE INDEX characters_parametrs_characters_pk_fk ON home.characters_parametrs (fk_character);
CREATE TABLE home.matches
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fk_status int(11),
    datetime_start datetime,
    datetime_finish datetime,
    CONSTRAINT matches_match_status_pk_fk FOREIGN KEY (fk_status) REFERENCES home.matches_statuses (pk)
);
CREATE INDEX matches_match_status_pk_fk ON home.matches (fk_status);
CREATE TABLE home.matches_logs
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fk_match int(11),
    fk_user_1 int(11),
    fk_user_2 int(11),
    datetime_event datetime,
    fk_event int(11),
    CONSTRAINT matches_logs_matches_pk_fk FOREIGN KEY (fk_match) REFERENCES home.matches (pk),
    CONSTRAINT matches_logs_users_pk_fk FOREIGN KEY (fk_user_1) REFERENCES home.users (pk),
    CONSTRAINT matches_logs_users_pk_fk_2 FOREIGN KEY (fk_user_2) REFERENCES home.users (pk)
);
CREATE INDEX matches_logs_matches_pk_fk ON home.matches_logs (fk_match);
CREATE INDEX matches_logs_users_pk_fk ON home.matches_logs (fk_user_1);
CREATE INDEX matches_logs_users_pk_fk_2 ON home.matches_logs (fk_user_2);
CREATE TABLE home.matches_logs_events
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    name varchar(255)
);
CREATE TABLE home.matches_statuses
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    status varchar(255)
);
CREATE UNIQUE INDEX match_status_status_uindex ON home.matches_statuses (status);
CREATE TABLE home.ratings_balls
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fk_user int(11),
    fk_message int(11),
    ball int(11),
    ball_datetime datetime,
    CONSTRAINT ratings_balls_users_pk_fk FOREIGN KEY (fk_user) REFERENCES home.users (pk),
    CONSTRAINT ratings_balls_rating_message_pk_fk FOREIGN KEY (fk_message) REFERENCES home.ratings_messages (pk)
);
CREATE INDEX ratings_balls_users_pk_fk ON home.ratings_balls (fk_user);
CREATE INDEX ratings_balls_rating_message_pk_fk ON home.ratings_balls (fk_message);
CREATE TABLE home.ratings_messages
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    message varchar(255)
);
CREATE TABLE home.users
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    login varchar(255) NOT NULL,
    password text NOT NULL,
    registration_date date NOT NULL,
    last_visit_date date NOT NULL,
    rating_ball int(10) unsigned DEFAULT '0',
    experience bigint(20) unsigned DEFAULT '0'
);
CREATE UNIQUE INDEX users_login_uindex ON home.users (login);
CREATE TABLE home.users_has_achievements
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fk_user int(11),
    fk_achievement int(11),
    CONSTRAINT users_has_achievements_users_pk_fk FOREIGN KEY (fk_user) REFERENCES home.users (pk),
    CONSTRAINT users_has_achievements_achievements_pk_fk FOREIGN KEY (fk_achievement) REFERENCES home.achievements (pk)
);
CREATE INDEX users_has_achievements_users_pk_fk ON home.users_has_achievements (fk_user);
CREATE INDEX users_has_achievements_achievements_pk_fk ON home.users_has_achievements (fk_achievement);
CREATE TABLE home.users_has_characters
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fk_user int(11),
    fk_character int(11),
    CONSTRAINT user_has_character_users_pk_fk FOREIGN KEY (fk_user) REFERENCES home.users (pk),
    CONSTRAINT user_has_character_character_pk_fk FOREIGN KEY (fk_character) REFERENCES home.characters (pk)
);
CREATE INDEX user_has_character_users_pk_fk ON home.users_has_characters (fk_user);
CREATE INDEX user_has_character_character_pk_fk ON home.users_has_characters (fk_character);
CREATE TABLE home.users_levels
(
    pk int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    level tinyint(3) unsigned,
    experience bigint(20) unsigned
);
